//import React, { useState } from 'react';
import './Style.css';
import user from '../Imges/utilisateur.png';
import noti from '../Imges/notification.png';


function nav () {
  return (
   <nav>
       <h2 className='logo'>Smart Tech</h2>
       <ul className='partG'>
           <li className='links'>Home</li>
           <li className='links'>Content</li>
           <li className='links'>Test server</li>
           <li className='links'>About US</li>
       </ul>
          <div className='kloi'>
             <div><img className='im' src={user}/></div>
             <div><img className='im' src={noti}/></div>
          </div>

   </nav>
  );
}
export default nav ;
